import React from 'react'
import './login.css'

export default function Login() {
    return (
        <>
            <form>
                <fieldset style={{ border: '2px black solid', padding: '10px' }}>
                    <h2
                        style={{
                            textAlign: 'center',
                            fontSize: '40px',
                            color: 'black',
                        }}
                    >
                        <b>
                            <u>Login</u>
                        </b>
                    </h2>
                </fieldset>
            </form>
        </>
    )
}
